import React, { Component } from 'react';
import ListArticlesComponent from './ListArticlesComponent';
import ArticleComonent from './ArticleComponent';
import CommentComonent from './CommentComponent';

class ArticleApp extends Component {
    render() {
        return (<>
        <div>
          <ArticleNavBar/>
        </div>
        <div className="container">
            <ArticleComonent/>
            <ListArticlesComponent/>
            <CommentComponent/>
        </div>
            </>
        )
    }
}

export default ArticleApp
